import Header from "../components/Header";
import styles from "./ProjectsPage.module.css";

const ProjectsPage = () => {
  return (
    <div className={styles.projectsPage}>
      <img
        className={styles.projectsPageChild}
        alt=""
        src="/Atlas.png"
      />
      <div className={styles.monkeyDLufy}>Atlas - ecommerce Website</div>
      <div className={styles.rectangleParent}>
        <img className={styles.frameChild} alt="" src="/Atlas_products.png" />
        <img className={styles.frameItem} alt="" src="/rectangle-241@2x.png" />
        <img className={styles.frameChild} alt="" src="/rectangle-251@2x.png" />
        <img className={styles.frameChild} alt="" src="/rectangle-26@2x.png" />
      </div>
      <div className={styles.loremIpsumDolorContainer}>
        <p className={styles.loremIpsumDolor}>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit.
        </p>
        <p
          className={styles.loremIpsumDolor}
        >{`Sed do eiusmod tempor incididunt ut labore et dolore magna `}</p>
        <p
          className={styles.loremIpsumDolor}
        >{`aliqua. Ut enim ad minim veniam, quis nostrud exercitation `}</p>
        <p
          className={styles.loremIpsumDolor}
        >{`ullamco laboris nisi ut aliquip ex ea commodo consequat. `}</p>
        <p
          className={styles.loremIpsumDolor}
        >{`Duis aute irure dolor in reprehenderit in voluptate velit esse `}</p>
        <p
          className={styles.loremIpsumDolor}
        >{`cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat `}</p>
        <p
          className={styles.loremIpsumDolor}
        >{`cupidatat non proident, sunt in culpa qui officia deserunt mollit `}</p>
        <p className={styles.loremIpsumDolor}>anim id est laborum.</p>
      </div>
      <Header />
    </div>
  );
};

export default ProjectsPage;
